import './App.css';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import { Chat } from './chat';

const App = () => (
  <div className="App">
    <Router>
      <Switch>
        <Route exact path="/" component={Chat} />
      </Switch>
    </Router>
  </div>
);

export default App;
